import React from 'react';
import logo from './logo.svg';
import './App.css';
import Login from './Components/Login'
function App() {
  return (
    <div className="app">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

        <button className="error">Error Button</button> 
        <Login/>
      </header>

    </div>
  );
}

export default App;
